// Navbar.js

import React from 'react';

const Navbar = () => {
  return (
    <div className="flex justify-between items-center p-4 bg-ac text-white">
      <div className="text-lg font-bold">Your Logo</div>
      <div className="flex">
        {/* Add your menu items here using Tailwind CSS classes */}
        <div className="mx-2">Menu Item 1</div>
        <div className="mx-2">Menu Item 2</div>
        <div className="mx-2">Menu Item 3</div>
      </div>
    </div>
  );
};

export default Navbar;
